const SearchBox = ({ handleSearch }) => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleChange = (e) => {
    const term = e.target.value;
    setSearchTerm(term);
    handleSearch(term);
  };

  return (
    <input
      type="text"
      placeholder="Search..."
      value={searchTerm}
      onChange={handleChange}
      className="form-control"
    />
  );
};

const Navbar = () => {
  const [formData, setFormData] = useState({
    ExpenseHead: '',
    ExpenseName: '',
    ExpenseDate: '',
    ExpenseAmount: '',
    ExpenseBy: '',
    VendorName: '',
    PaymentMode: '',
    BillNumber: '',
    Bill: '',
    ExpenseDetail: ''
  });

  const [ExpenseName, setExpenseName] = useState([]);
  const [filteredVendorName, setFilteredVendorName] = useState([]);

  useEffect(() => {
    setFilteredVendorName(ExpenseName);
  }, [ExpenseName]);

  const handleChange = (e, rowIndex, columnName) => {
    const { value } = e.target;
    const updatedExpenseName = ExpenseName.map((Expense, index) => {
      if (index === rowIndex) {
        return {
          ...Expense,
          [columnName]: value
        };
      }
      return Expense;
    });
    setExpenseName(updatedExpenseName);
    setFilteredVendorName(updatedExpenseName);
  };

  const handleAddRow = () => {
    setExpenseName([...ExpenseName, formData]);
    setFormData({
      ExpenseHead: '',
      ExpenseName: '',
      ExpenseDate: '',
      ExpenseAmount: '',
      ExpenseBy: '',
      VendorName: '',
      PaymentMode: '',
      BillNumber: '',
      Bill: '',
      ExpenseDetail: ''
    });
  };

  const handleSearch = (searchTerm) => {
    console.log("Search term:", searchTerm);
    const filteredExpenseName = ExpenseName.filter(Expense => {
      return Object.values(Expense).some(value =>
        value.toLowerCase().includes(searchTerm.toLowerCase())
      );
    });
    console.log("Filtered ExpenseName:", filteredExpenseName);
    setFilteredVendorName(filteredExpenseName);
  };

  const expenseHeadOptions = ['Option 1', 'Option 2', 'Option 3'];
  const paymentModeOptions = ['Cash', 'Credit Card', 'Debit Card', 'Net Banking', 'UPI'];
  const VendorNameOptions = ['Vendor 1', 'Vendor 2', 'Vendor 3']; // Added VendorName options

  return (
    <div className='container-fluid' style={{ backgroundColor: 'white' }}>
      <div className="header bg-info text-white px-3 py-2 d-flex justify-content-between align-items-center">
        <h1 className="m-0">Expense Add</h1>
        <div className="d-flex align-items-center">
          <label htmlFor="languageSelect" className="mb-0 mr-3">Language:</label>
          <select id="languageSelect" className="form-control mr-3">
            <option value="english">English</option>
            <option value="hindi">Hindi</option>
          </select>
          <a className="nav-link" href="/">
            {/* Home Icon */}
          </a>
        </div>
      </div>

      <div className="px-3 py-4">
        <form>
          <div className="row">
            <div className="col-md-4">
              <div className="form-group">
                <label htmlFor="ExpenseHead">Expense Head<span style={{ color: 'red' }}>*</span> : </label>
                <select id="ExpenseHead" name="ExpenseHead" value={formData.ExpenseHead} onChange={(e) => setFormData({ ...formData, ExpenseHead: e.target.value })} className="form-control">
                  <option value="">Select Expense Head</option>
                  {expenseHeadOptions.map((option, index) => (
                    <option key={index} value={option}>{option}</option>
                  ))}
                </select>
              </div>
              <div className="form-group">
                <label htmlFor="ExpenseName">Expense Name<span style={{ color: 'red' }}>*</span> : </label>
                <input type="text" id="ExpenseName" name="ExpenseName" value={formData.ExpenseName} onChange={(e) => setFormData({ ...formData, ExpenseName: e.target.value })} className="form-control" />
              </div>
              <div className="form-group">
                <label htmlFor="ExpenseDate">Expense Date<span style={{ color: 'red' }}>*</span> : </label>
                <input type="text" id="ExpenseDate" name="ExpenseDate" value={formData.ExpenseDate} onChange={(e) => setFormData({ ...formData, ExpenseDate: e.target.value })} className="form-control" />
              </div>
            </div>
            <div className="col-md-4">
              <div className="form-group">
                <label htmlFor="ExpenseAmount">Expense Amount<span style={{ color: 'red' }}>*</span> : </label>
                <input type="text" id="ExpenseAmount" name="ExpenseAmount" value={formData.ExpenseAmount} onChange={(e) => setFormData({ ...formData, ExpenseAmount: e.target.value })} className="form-control" />
              </div>
              <div className="form-group">
                <label htmlFor="ExpenseBy">Expense By : </label>
                <input type="text" id="ExpenseBy" name="ExpenseBy" value={formData.ExpenseBy} onChange={(e) => setFormData({ ...formData, ExpenseBy: e.target.value })} className="form-control" />
              </div>
              <div className="form-group">
                <label htmlFor="VendorName">Vendor Name<span style={{ color: 'red' }}>*</span> : </label>
                <select id="VendorName" name="VendorName" value={formData.VendorName} onChange={(e) => setFormData({ ...formData, VendorName: e.target.value })} className="form-control">
                  <option value="">Select VendorName</option>
                  {VendorNameOptions.map((option, index) => (
                    <option key={index} value={option}>{option}</option>
                  ))}
                </select>
              </div>
            </div>
            <div className="col-md-4">
              <div className="form-group">
                <label htmlFor="PaymentMode">Payment Mode<span style={{ color: 'red' }}>*</span> : </label>
                <select id="PaymentMode" name="PaymentMode" value={formData.PaymentMode} onChange={(e) => setFormData({ ...formData, PaymentMode: e.target.value })} className="form-control">
                  <option value="">Select Payment Mode</option>
                  {paymentModeOptions.map((option, index) => (
                    <option key={index} value={option}>{option}</option>
                  ))}
                </select>
              </div>
              <div className="form-group">
                <label htmlFor="BillNumber">Bill Number<span style={{ color: 'red' }}>*</span> : </label>
                <input type="text" id="BillNumber" name="BillNumber" value={formData.BillNumber} onChange={(e) => setFormData({ ...formData, BillNumber: e.target.value })} className="form-control" />
              </div>
              <div className="form-group">
                <label htmlFor="Bill">Bill<span style={{ color: 'red' }}>*</span> : </label>
                <input type="text" id="Bill" name="Bill" value={formData.Bill} onChange={(e) => setFormData({ ...formData, Bill: e.target.value })} className="form-control" />
              </div>
            </div>
          </div>
          <div className="form-group">
            <label htmlFor="ExpenseDetail">Expense Detail : </label>
            <input type="text" id="ExpenseDetail" name="ExpenseDetail" value={formData.ExpenseDetail} onChange={(e) => setFormData({ ...formData, ExpenseDetail: e.target.value })} className="form-control" />
          </div>
          <div className="text-center">
            <button className="btn btn-outline-success" type="button" onClick={handleAddRow}>Submit</button>
          </div>
        </form>
      </div>

      <div className="header bg-info text-white px-3 py-2 d-flex align-items-left justify-content-left">
        <h1 className="m-0">Expense List</h1>
      </div>

      <div className="search-box px-3 py-4 text-right">
        <SearchBox handleSearch={handleSearch} />
      </div>

      <div className="table-responsive px-3 py-4">
        <table className="table">
          <thead>
            <tr>
              <th>ExpenseHead</th>
              <th>ExpenseName</th>
              <th>ExpenseDate</th>
              <th>ExpenseAmount</th>
              <th>ExpenseBy</th>
              <th>VendorName</th>
              <th>PaymentMode</th>
              <th>BillNumber</th>
              <th>Bill</th>
              <th>ExpenseDetail</th>
            </tr>
          </thead>
          <tbody>
            {filteredVendorName?.map((Expense, rowIndex) => (
              <tr key={rowIndex}>
                {Object.entries(Expense).map(([columnName, value], colIndex) => (
                  <td key={colIndex}>
                    <div className="form-group">
                      <input
                        type="text"
                        value={value}
                        onChange={(e) => handleChange(e, rowIndex, columnName)}
                        className="form-control"
                      />
                    </div>
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Navbar;
